import React from "react"; 
import {Outlet} from "react-router-dom";
import Navbar from "../navbar"; 
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { library } from "@fortawesome/fontawesome-svg-core";
import { faUser } from "@fortawesome/free-solid-svg-icons";


const Layout = () => {   
    return (     
        <> 
            <aside>
                <img src="https://placehold.co/165x165" className="img_profile img_circle"></img><br></br>
                <a href="mailto:sorayataraszka@gmail.com">sorayataraszka@gmail.com</a>
                <Navbar />
            </aside>
            <main>
                <header className="page_hero">
                    <h1 className="page_title"> <faUser /> Soraya Taraszka</h1>
                    <ul className="skills_buttons">
                        <li>Wordpress</li>
                        <li>PHP</li>
                        <li>React</li>
                        <li>Figma</li>
                    </ul>
                </header>
                <Outlet />     
            </main>
        </>   
    ); 
}; export default Layout;
